import useEth from "../contexts/EthContext/useEth";
import { useState } from "react";

function Owner({ voters, getVoters, actualStatus }) {
  const { state } = useEth();
  const { contract, accounts } = state;

  const [address, setAddress] = useState(null);
  const [workflowStatus, setWorkflowStatus] = useState(0);

  //console.log(contract.)

  function handleChange(event) {
    setAddress(event.target.value);
  }
  function wfChange(event) {
    setWorkflowStatus(
      event.contract.methods.workflowStatus().call({ from: accounts[0] })
    );
  }

  const addVoter = async () => {
    if (address.length === 42) {
      const result = await contract.methods.addVoter(address).send({
        from: accounts[0],
      });
      console.log(result);

      getVoters();
    }
  };

  const startProposalsRegistering = async () => {
    const result = await contract.methods.startProposalsRegistering().send({
      from: accounts[0],
    });
    console.log(result);
  };
  const endProposalsRegistering = async () => {
    const result = await contract.methods.endProposalsRegistering().send({
      from: accounts[0],
    });
    console.log(result);
  };
  const startVotingSession = async () => {
    const result = await contract.methods.startVotingSession().send({
      from: accounts[0],
    });
    console.log(result);
  };
  const endVotingSession = async () => {
    const result = await contract.methods.endVotingSession().send({
      from: accounts[0],
    });
    console.log(result);
  };
  const tallyVotes = async () => {
    const winner = await contract.methods.tallyVotes().send({
      from: accounts[0],
    });

    console.log(winner);
  };

  function getStatusName() {
    switch (actualStatus) {
      case 0:
        return "Registering voters";
        break;
      case 1:
        return "Proposals Registration Started";
        break;
      case 2:
        return "Proposals Registration Ended";
        break;
      case 3:
        return "Voting Session Started";
        break;
      case 4:
        return "VotingSessionEnded";
        break;
      case 5:
        return "Votes Tallied";
        break;

      default:
        console.log("pbm");
        break;
    }
  }

  return (
    <div className="wrapDiv">
      <div className="userAdd">
        <h4>Adresse connectée au wallet: {state.accounts}</h4>
        <h4>Statut actuel du workflow: {getStatusName()}</h4>
      </div>
      <h3>Voters addresses</h3>
      <ul>
        {voters.map((voter, index) => (
          <li>
            <h3>
              Proposition: <strong>{voter.returnValues.voterAddress}</strong>
            </h3>
          </li>
        ))}
      </ul>
      <div className="addVoter">
        <br />
        <h1 className="text-2xl">Ajout voter</h1>
        <br />
        <h2>Adresse user: </h2>
        <br />
        <input type={"text"} name="addVoter" onChange={handleChange} />
        <br />
        <button display="block" className="button" onClick={addVoter}>
          Add voter
        </button>
        <br />
      </div>
      <br />
      <div className="startRegister">
        <h1 className="text-2xl">Start registering</h1>
        <br />
        <button className="button" onClick={startProposalsRegistering}>
          Open registering
        </button>
      </div>
      <br />
      <div className="endRegister">
        <h1 className="text-2xl">End registering</h1>
        <br />

        <button className="button" onClick={endProposalsRegistering}>
          Close registering
        </button>
      </div>
      <div className="startVoting">
        <h1 className="text-2xl">startVoting</h1>
        <br />
        <button className="button" onClick={startVotingSession}>
          Start Voting session
        </button>
      </div>
      <div className="endVoting">
        <h1 className="text-2xl">End voting session</h1>
        <br />
        <button className="button" onClick={endVotingSession}>
          Close registering
        </button>
      </div>
      <div className="tallyVotes">
        <h1 className="text-2xl">Tally votes</h1>
        <br />
        <button className="button" onClick={tallyVotes}>
          Tally votes
        </button>
        <h3>La proposition gagnante est: </h3>
      </div>
    </div>
  );
}

export default Owner;
